var OnFMReady=function(){return class{static runFunction(t,...n){let r=setInterval(()=>{console.log("wait"),"object"==typeof FileMaker&&(clearInterval(r),t.call(this,...n))})}static runScript(t,n){this.runFunction(()=>{FileMaker.PerformScript(t,n)})}static run(...t){"string"==typeof t[0]?this.runScript(t[0],t[1]):this.runFunction(...t)}}}();